import React from "react";

const ItemCard = (props) => {

  const items = props.items;

  const setStore = items.map((item) => {
    return(
      <h1>Hello from Item</h1>
    )
  })


  return(
    <div>
      {setStore}
    </div>
  )
}

export default ItemCard;
